import styled from "styled-components"
import {Swiper, SwiperSlide} from 'swiper/react'
import 'swiper/css'
import {Navigation,EffectFade} from 'swiper'
import 'swiper/css/navigation'
import 'swiper/css/effectFade'
import './Template.css'
import React from 'react'


export const Proje = ()=> {


const Containert = styled.div`
color: white;
display: flex;
height: 90vh;
width: 100%;
justify-content: center;
align-items: center;
`


    return(
        <Containert>
           <div>
            <Swiper modules={[Navigation,EffectFade]} navigation effect speed={900} slidesPerview={1} loop className={styles.myswiper}>


            </Swiper>
           </div>
        </Containert>
    )
}
